    const MainSection = styled.section`
    margin: 0px;
    padding:0px;
    
`; //ContentWarp 메인 css
const ReportBtn = styled.button`
position: relative;
padding: 0 0 0 15px;
font-size: 14px;
background: none;
border: none;
color: #e75858;
margin-top: -15px;
`;
const ReportA = styled.a`
margin-top: 16px;
text-decoration: none;
`;
    return(
        <MainSection>
            <ReportA href="/">
                <ReportBtn>
                    신고
                </ReportBtn>
            </ReportA>
        </MainSection>
    )

}

export default Header;
